import React from 'react';
import Question from './Question';
import { getQuestionsByPage } from '../data/questions';

const TestPage = ({ page, answers, onAnswer }) => {
  const questions = getQuestionsByPage(page);

  return (
    <div>
      {questions.map((question, index) => {
        const questionIndex = ((page - 1) * 9) + index;
        return (
          <Question
            key={question.id}
            question={`${questionIndex + 1}. ${question.text}`}
            selectedAnswer={answers[questionIndex]}
            onAnswer={(value) => onAnswer(questionIndex, value)}
          />
        );
      })}
    </div>
  );
};

export default TestPage;
